import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import styled from "styled-components";
import { useRouter } from "next/router";
import { Avatar, Drawer } from "@material-ui/core";
import WithLayout from "../../../components/Landlrd/Layout";
import { theme as customTheme } from "../../../components/Page";
import {
  Container,
  CaptionText,
  SubText,
  Header
} from "../../../components/styledComponents";

import ActiveTab from "../../../components/Landlrd/ActiveTab";
import hasLogo from "../../../public/static/HAS.png";

const useStyles = makeStyles(theme => ({
  small: {
    width: theme.spacing(10),
    height: theme.spacing(10),
    borderRadius: 0,
    backgroundColor: "transparent",
    border: 0
  },

  menuButton: {
    marginRight: 36
  },
  hide: {
    display: "none"
  },

  drawerPaper: {
    paddingLeft: "100px",
    paddingRight: "100px",
    // height: 64,
    backgroundColor: "white"
  },
  toolbar: {
    display: "flex",
    alignItems: "center",
    flexDirection: "row",
    justifyContent: "space-between",
    padding: theme.spacing(0, 1),
    ...theme.mixins.toolbar
  },
  content: {
    backgroundColor: customTheme.bgPrimary
  },
  smaller: {
    width: theme.spacing(7),
    height: theme.spacing(7)
  },
  userAvatar: {
    width: theme.spacing(4.5),
    height: theme.spacing(4.5)
  }
}));
const HeaderSection = styled(Container)`
  display: flex;
  width: 100%;
  flex-direction: row;
  padding-top: 30px;
  padding-left: 110px;
  padding-right: 110px;
  padding-bottom: 20px;
  background-color: white;
`;
const ContentSection = styled(Container)`
  display: flex;
  flex-direction: column;
  width: 100%;
  padding: 0px 110px;
  background-color: red;
`;
const Tag = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  border-radius: 20px;
  background-color: #e1e1e1;
  padding: 4px 15px;
  margin: 0px 2px;
`;

const House = Page => props => {
  const classes = useStyles();
  const router = useRouter();
  const { id } = props.query;
  console.log(router);
  return (
    <Container flex={1}>
      <Page />
    </Container>
  );
};

export default WithLayout(House);

